r($,"aBw","QB",()=>A.b([A.n1("assets/images/chat_background.png","This is a normal chat application, to send messages, video call with others. I developed both front-end and back-end.\n\nTechnology used:\n- Flutter\n- Firebase\n- Node.js\n- Express.js\n- MongoDB\n- Github\n- Postman\n- Socket.io\n- Android Studio\n- Visual Studio Code","","","https://github.com/Hoangvu75/flutter_chatapp","Chat","https://drive.google.com/file/d/1AVF5pSkILjJNW3rvE2WMJGY-kEYjmlnd/view?usp=sharing"),A.n1("assets/images/movie_background.jpg","Application for movie lovers, to catch information about trending and popular movies. Users can also search for any movie they like.\n\nTechnology used:\n- Flutter\n- Postman\n- Github\n- Android Studio","","","https://github.com/Hoangvu75/flutter_movie_provider","Movie app","https://drive.google.com/file/d/19yj-3DyX5i9WCPV_wBloDvfumAslVIXD/view?usp=sharing"),A.n1("assets/images/social_network_background.jpg","A simple social network, users can add friend, post status, chat and interact with others.\n\nTechnology used:\n- Kotlin\n- Github\n- Firebase\n- Android Studio","","","https://github.com/Hoangvu75/android_social_network","Social network","https://drive.google.com/file/d/1-KFMDq9XlgcSBRuY2Yddlg7ZzPhno_jF/view?usp=sharing"),A.n1("assets/images/hoangvu_techblog_background.png","This is my own blog about Technology. Everyone can come here and reach the lasted update of new technology in many fields such as Web, Mobile, AI, Game,...\n\nTechnology used:\n- Flutter\n- Github\n- Vercel\n- HTML/CSS","https://hoangvu-tech-blog.vercel.app/","","","Hoang Vu's Tech Blog",""),A.n1("assets/images/weather_background.jpg","Users can use this application to get information about weather at their location, and can also get data of weather in anywhere on the world.\n\nTechnology used:\n- Java\n- Kotlin\n- Github\n- Android Studio","","","https://github.com/Hoangvu75/android_weather_forecast","Weather forecast","https://drive.google.com/file/d/1-7wVrpZ3W5J1n6Lf9GUFIFk2jDIPXCKN/view?usp=sharing"),A.n1("assets/images/student_manager_background.png","Backend project is a student management system that allows users to perform various CRUD (Create, Read, Update, Delete) operations on a database of student records. Using HTTP methods like GET, POST, PUT, and DELETE, users can add new students to the database, retrieve a list of all students, update the information of an existing student, search for a student by name, and delete a student record from the database.\n\nTechnology used:\n- TypeScript\n- Node.js\n- Express.js\n- MongoDB\n- Github\n- Postman\n- Visual Studio Code","https://nodejsstudentmanager-production.up.railway.app/#/","","https://github.com/Hoangvu75/nodejs_student_manager","Student Manager",""),A.n1("assets/images/xinhxinh_background.png","This is an e-commerce application, users can use this application to livestream, advertise products, purchase, trade, put on sale everything such as clothes, electronic devices, cosmetics, housewares, food, ... Xinhxinhlive is a project of FPT Telecom and I'm joined this as a mobile developer.\n\nTechnology used:\n- Java\n- Fork\n- Gitlab\n- Postman\n- Android Studio","","https://play.google.com/store/apps/details?id=com.flive.xinhxinhlive&hl=vi&gl=US","","Xinhxinhlive",""),A.n1("assets/images/techday_background.jpg","Techday 2022 is an application for FPT staff only, which used for FPT technology events tracking, published on CH Play. I joined this project when I worked at FPT Telecom.\n\nTechnology used:\n- Flutter\n- Fork\n- Gitlab\n- Postman\n- Android Studio","","https://play.google.com/store/apps/details?id=com.fpt.techday&hl=en_US&gl=US&pli=1","","Techday 2022","")],A.X("w<Gs>")))
